import React, { Component } from 'react'

export default class Comments extends Component {
  render() {
    const comments = this.props.location.state;
    return (
      <div className='Comment'>
        <ul>
         { comments.map((c,idx) => {
           <li key={c.id}>
             
             {c.comment}
             </li>
         })}
        </ul>
      </div>
    )
  }
}
